const linkReducer = (state = { link: "" }, action) => {
    switch (action.type) {
      default:
        return state;
  
      case "about":
        return { link: "about" };
  
      case "home":
        return { link: "home" };
    
      case "login":
        return { link: "login" };

      case "signUp":
        return { link: "signUp" };
    }
  };
  
  export default linkReducer;
